import React from "react";
import "./home.css";
export default function home() {
  return (
    <div className="home">
      <header className="w-full h-32 bg-black text-white  font-extrabold space-x-11 tracking-widest bg-center flex justify-center items-center">
        <h1 className="heading">MAGAZINE</h1>
      </header>
    </div>
  );
}
